functionContents.read_color:
def read_color():
    #check if block is being held
    if not is_present():
        return "None"
    
    rgb = color_sensor.rgb()
    return rgb_to_color(rgb)

functionContents.rgb_to_color:
def rgb_to_color(rgb):
    if rgb[0] > (rgb[1] + rgb[2]) / 2:
        if (rgb[1] >= rgb[0] / 4) and rgb[1] > 1:
            return "YELLOW"
        return "RED"
    elif rgb[1] + 1 > (rgb[0] + rgb[2]) / 2:
        return "GREEN"
    elif rgb[2] > (rgb[0] + rgb[1]) / 2:
        return "BLUE"
    return "None"

functionContents.move_arm:
def move_arm():
    #reset arm
    elbow_motor.run_target(60, 15)
    base_motor.run_target(150, 0)
    ev3.screen.draw_text(0, 50, "Move arm")

    #move arm
    while True:
        pressed = ev3.buttons.pressed()
        if Button.LEFT in pressed:
            base_motor.run(50)
        elif Button.RIGHT in pressed:
            base_motor.run(-50)
        elif Button.UP in pressed:
            elbow_motor.run(20)
        elif Button.DOWN in pressed:
            elbow_motor.run(-20)
        elif Button.CENTER in pressed:
            break
        else:
            base_motor.brake()
            elbow_motor.brake()

    #save arm position
    pos = base_motor.angle()
    hgt = elbow_motor.angle()

    #reset arm
    elbow_motor.run_target(60, 15)
    base_motor.run_target(150, 0)

    ev3.screen.clear()

    return (pos, hgt)
